import React from 'react';
import { BrowserRouter } from 'react-router-dom';

import Routes from './routes/index';
import GloboStyles from './styles/globalStyles';

const App: React.FC = () => (
  <>
    <BrowserRouter>
      <Routes />
    </BrowserRouter>
    <GloboStyles />
  </>
);

export default App;
